import React from 'react';

import * as pages from '../../../Pages/pages';

import classes from './MobileMenu.module.css';

import burgerIcon from '../../../assets/Header/burger.png';
import calendarIcon from '../../../assets/Header/calendar.png';

const MobileMenu = (props) => {
    let button;

    switch (props.forPage) {
        case pages.LANDING_PAGE:
            button = "Log in";
            break;
        case pages.SEARCH_RESULTS:
            button = <p><img src={calendarIcon} alt="Calendar"/>Bookings</p>;
            break;
        default:
            button = "Log in";
            break;
    }

    return (
        <div className={classes.MobileMenu}>
            <button>{button}</button>
            <img src={burgerIcon} className={classes.burgerIcon} alt="Burger Icon"/>
        </div>
    );
};

export default MobileMenu;
